var inputInterval = 60;

var xscaleMinutesToHours = arr => {
	let result = {};
	for (i = 0; i < 1440 / inputInterval; i++)
		result[i] = 0;
	for (let key in arr)
		result[ Math.floor(Number(key) / inputInterval) ] += arr[key];
	return result;
};

var xscaleHoursToMinutes = arr => {
	let result = {};
	for (let key in arr) {
		for (let shift = 0; shift < inputInterval; shift++)
			result[inputInterval * Number(key) + shift] = arr[key] / inputInterval;
	}
	return result;
};

var kernelDiameter = 0;
var kernel = [1];

var convolute = (arr) => {
	let kernelArea = kernel.reduce( (a,b) => a+b );
	let result = {};
	for (let key in arr) {
		let val = arr[key];
		let pos = Number(key) + kernelDiameter;
		for (let k in kernel) {
			let tpos = (pos + 1440) % 1440;
			if (!result[tpos]) result[tpos] = 0;
			result[tpos] += kernel[k] * val / kernelArea;
			pos--;
		}
	}
	return result;
};

