let factorsOf1440 = [];
for (let a = 0; a < 6; a++) {
	for (let b = 0; b < 3; b++) {
		for (let c = 0; c < 2; c++) {
			let [A,B,C] = [2,3,5].map( (n,i) => Math.pow(n, [a,b,c][i]) );
			factorsOf1440.push(A*B*C);
		}
	}
}
factorsOf1440 = factorsOf1440.sort( (a,b) => a-b );

window.updateChart = () => {
	let dist = JSON.parse(messageDist);
	for (d in dist) {
		if (!document.getElementById(`cb${d}`).checked)
			delete dist[d];
	}
	
	kernelDiameter = Number( document.getElementById('smoothing').value );
	document.getElementById('smoothingvalue').value = kernelDiameter;
	kernel = [...Array(2 * kernelDiameter + 1)].map(  (o,i) =>  1 + kernelDiameter -  Math.abs( i - kernelDiameter )  );
//	kernel = [...Array(2 * kernelDiameter + 1)].map(  (o,i) =>  1  );
	inputInterval = factorsOf1440[  Number( document.getElementById('inputinterval').value )  ];
	document.getElementById('inputintervalvalue').value = inputInterval;
	let normalize = document.getElementById('normalize').checked;
	
	for (let id in dist) {
		dist[id] = xscaleMinutesToHours(dist[id]);
		dist[id] = xscaleHoursToMinutes(dist[id]);
		dist[id] = convolute(dist[id]);
	}
	
//	dist['Kernel'] = kernel;
	
	let maxTotal = 1;
	for (let id in dist) {
		let max = 0.0001;
		for (let t in dist[id])
			if (dist[id][t] > max) max = dist[id][t];
		if (max > maxTotal) maxTotal = max;
		if (normalize) {
			for (let t in dist[id])
				dist[id][t] = dist[id][t] / max;
		}
	}
	
	let DATASETS = Object.keys(dist).map( (id, index) => ({
		label: id,
		backgroundColor: window.hashColor(id),
		borderColor: window.hashColor(id),
		data: Object.keys(dist[id]).map( t => ({ x: t / 60, y: dist[id][t] }) ),
		fill: false,
		pointRadius: 0,
		pointHoverRadius: 2,
		pointHitRadius: 4
	}) );
	
	let estOffset = -5;
	let date = new Date();
	let gmt = date.getTime() + (date.getTimezoneOffset() * 60000);
	let est = new Date( gmt + 3600000 * estOffset );
	let estMinutes = 60 * est.getHours() + est.getMinutes();
	
	DATASETS.push({
		label: "Current Time",
		backgroundColor: "red",
		borderColor: "red",
		data: [{ x: estMinutes / 60, y: normalize ? 1 : maxTotal }, { x: estMinutes / 60 + 0.05, y: normalize ? 1 : maxTotal }],
		fill: true,
		pointRadius: 0,
		pointHoverRadius: 2,
		pointHitRadius: 4
	});
	
	config.data.datasets = DATASETS;
	
	window.jsChart.update();
};

